--- CRIANDO TABELA VEÍCULO
CREATE TABLE veiculo (
    veiculo_id SERIAL PRIMARY KEY,
    montadora VARCHAR(50) NOT NULL,
    modelo VARCHAR(50) NOT NULL,
    ano_fabricacao INT NOT NULL,
    tipo VARCHAR(20) NOT NULL,
    cor VARCHAR(20) NOT NULL,
    tipo_cambio VARCHAR(20) NOT NULL,
    tipo_combustivel VARCHAR(20) NOT NULL,
    potencia_motor VARCHAR(10) NOT NULL,
	status VARCHAR(30) NOT NULL
);

--- POPULANDO TABELA VEÍCULO


--- CRIANDO TABELA FORNECEDOR
CREATE TABLE fornecedor (
    fornecedor_id SERIAL PRIMARY KEY,
    nome_fornecedor VARCHAR(100) NOT NULL,
    bairro VARCHAR(50) NOT NULL,
    cidade VARCHAR(50) NOT NULL,
    estado VARCHAR(20) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    email VARCHAR(100) NOT NULL,
    cnpj VARCHAR(20) NOT NULL UNIQUE
);

--- POPULANDO TABELA FORNECEDOR

--- CRIANDO A TABELA FILIAL
CREATE TABLE filial (
    filial_id SERIAL PRIMARY KEY,
    bairro VARCHAR(50) NOT NULL,
    cidade VARCHAR(50) NOT NULL,
    estado VARCHAR(20) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    email VARCHAR(100) NOT NULL,
    cnpj VARCHAR(20) NOT NULL UNIQUE
);

--- POPULANDO A TABELA FILIAL

---  CRIANDO A TABELA COMPRA
CREATE TABLE compra (
    compra_id SERIAL PRIMARY KEY,
    veiculo_id INT NOT NULL,
    fornecedor_id INT NOT NULL,
    filial_id INT NOT NULL,
    data_compra DATE NOT NULL,
    preco_compra DECIMAL(10, 2) NOT NULL,
    FOREIGN KEY (veiculo_id) REFERENCES veiculo(veiculo_id),
    FOREIGN KEY (fornecedor_id) REFERENCES fornecedor(fornecedor_id),
    FOREIGN KEY (filial_id) REFERENCES filial(filial_id)
);

---  POPULANDO A TABELA COMPRA

--- CRIANDO A TABELA CLIENTE
CREATE TABLE cliente (
    cliente_id SERIAL PRIMARY KEY,
    nome_completo VARCHAR(100) NOT NULL,
    data_nascimento DATE NOT NULL,
    genero CHAR(1) NOT NULL,
    estado_civil CHAR(1) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    email VARCHAR(100) NOT NULL,
    cpf VARCHAR(14) NOT NULL UNIQUE,
    rua VARCHAR(100) NOT NULL,
    numero VARCHAR(10) NOT NULL,
    complemento VARCHAR(50),
    bairro VARCHAR(50) NOT NULL,
    cidade VARCHAR(50) NOT NULL,
    estado VARCHAR(20) NOT NULL
);

--- POPULANDO A TABELA CLIENTE

--- CRIANDO A TABELA VENDEDOR
CREATE TABLE vendedor (
    vendedor_id SERIAL PRIMARY KEY,
    filial_id INT NOT NULL,
    nome_completo VARCHAR(100) NOT NULL,
    data_nascimento DATE NOT NULL,
    genero CHAR(1) NOT NULL,
    estado_civil CHAR(1) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    email VARCHAR(100) NOT NULL,
    cpf VARCHAR(14) NOT NULL UNIQUE,
    rua VARCHAR(100) NOT NULL,
    numero VARCHAR(10) NOT NULL,
    complemento VARCHAR(50),
    bairro VARCHAR(50) NOT NULL,
    cidade VARCHAR(50) NOT NULL,
    estado VARCHAR(20) NOT NULL,
    FOREIGN KEY (filial_id) REFERENCES filial(filial_id)
);

--- POPULANDO A TABELA VENDEDOR

---CRIANDO A TABELA VENDAS
CREATE TABLE venda (
    venda_id SERIAL PRIMARY KEY,
    veiculo_id INT NOT NULL,
    compra_id INT NOT NULL,
    vendedor_id INT NOT NULL,
    cliente_id INT NOT NULL,
    data_venda DATE NOT NULL,
    valor_venda DECIMAL(10, 2) NOT NULL,
    FOREIGN KEY (veiculo_id) REFERENCES veiculo(veiculo_id),
    FOREIGN KEY (compra_id) REFERENCES compra(compra_id),
    FOREIGN KEY (vendedor_id) REFERENCES vendedor(vendedor_id),
    FOREIGN KEY (cliente_id) REFERENCES cliente(cliente_id)
);

---POPULANDO A TABELA VENDAS

--- CRIANDO A TABELA ALUGUEL
CREATE TABLE aluguel (
    aluguel_id SERIAL PRIMARY KEY,
    veiculo_id INT NOT NULL,
    cliente_id INT NOT NULL,
    filial_id INT NOT NULL,
    data_aluguel DATE NOT NULL,
    data_devolucao DATE NOT NULL,
    quilometragem INT NOT NULL,
    valor_pago DECIMAL(10, 2) NOT NULL,
    FOREIGN KEY (veiculo_id) REFERENCES veiculo(veiculo_id),
    FOREIGN KEY (cliente_id) REFERENCES cliente(cliente_id),
    FOREIGN KEY (filial_id) REFERENCES filial(filial_id)
);

--- POPULANDO A TABELA ALUGUEL

--- CRIANDO A TABELA VENDA
CREATE TABLE pagamento_venda (
    pagamento_venda_id SERIAL PRIMARY KEY,
    venda_id INT NOT NULL,
    tipo_pagamento VARCHAR(10) NOT NULL,
    metodo_pagamento VARCHAR(20) NOT NULL,
    valor_pago DECIMAL(10, 2) NOT NULL,
    status VARCHAR(10) NOT NULL,
    data_pagamento DATE NOT NULL,
    FOREIGN KEY (venda_id) REFERENCES venda(venda_id)
);

--- POPULANDO A TABELA VENDA

--- CRIANDO A TABELA PAGAMENTO_ALUGUEL
CREATE TABLE pagamento_aluguel (
    pagamento_aluguel_id SERIAL PRIMARY KEY,
    aluguel_id INT NOT NULL,
    tipo_pagamento VARCHAR(10) NOT NULL,
    metodo_pagamento VARCHAR(20) NOT NULL,
    valor_pago DECIMAL(10, 2) NOT NULL,
    status VARCHAR(10) NOT NULL,
    data_pagamento DATE NOT NULL,
    FOREIGN KEY (aluguel_id) REFERENCES aluguel(aluguel_id)
);

